import React, { Component } from 'react';
import Header from './component/header';
import Headline from './component/headline';
import './app.scss';

class App extends Component {

  render() {
    return (
      <div>
        <Header />
        <section>
            <Headline header={hello} desc="Click the button to render posts!" />
        </section>
      </div>
    );
  }
}


export default App;
